import React from 'react';
import backgroundPic from '../../../Logo/healthy-diet.jpg'


export default class HomeContainer extends React.Component {
    render(){
        
        return (
            <div style={{position:'absolute',marginTop:'60px',width:'100%'}}>
            <div style={{ backgroundImage:`url(${backgroundPic})`,height:'50%',backgroundRepeat:'no-repeat',backgroundSize: '100%',marginRight:'0px'}}>

            </div>
            </div>
        )}
}
